class LyfeCanvas(Frame):
	def __init__(self, project, *args, **kwargs):
		Frame.__init__(self, *args, **kwargs)
		self.configure(borderwidth = 1, background= "#bbbbbb")
		self.project = project
		self.first_draw = True
		self.canvas = ResizableCanvas(self, background= "#FFFFFF")
		self.canvas.pack(fill = "both", expand = True)
		self.canvas.configure(width = 200, height = 200)
		self.canvas_width = self.canvas.winfo_width()
		self.canvas_height = self.canvas.winfo_height()
		self.empty_symbol = load_tk_image_object_from_bytes_array(empty_symbol_bytes)
		self.resized_empty_symbol = self.empty_symbol
		self.redraw()
		self.canvas.bind('<Configure>', self.on_configure)
		self.last_array = None

	def clear(self): self.canvas.delete("all")

	def itterate_canvas(self):
		for j in range(self.project.selected_frame.height):
			for i in range( self.project.selected_frame.width):
				yield f"{i}x{j}"

	def get_cell_id(self, pointer_x ,pointer_y):
		if pointer_x < 0 or pointer_y < 0: return
		for id in self.itterate_canvas():
			x, y = id.split("x")
			left_bound = float(x) * (1.0 /  float(self.project.selected_frame.selected_layer.width) * float(self.winfo_width()))
			right_bound = left_bound + self.pixel_width
			top_bound = float(y) * (1.0 / float(self.project.selected_frame.selected_layer.height) * float(self.winfo_height()))
			bottom_bound = top_bound + self.pixel_height
			if pointer_x > left_bound and pointer_x < right_bound:
				if pointer_y > top_bound and pointer_y < bottom_bound:
					return id
			left_bound -= 0.1
			right_bound += 0.1
			top_bound -= 0.1
			bottom_bound += 0.1
			if left_bound < pointer_x and pointer_x < right_bound:
				if top_bound < pointer_y and pointer_y < bottom_bound:
					return id

	def redraw(self, event = None, force = False):
		layer = self.project.selected_frame.selected_layer
		self.clear()
		self.canvas_width = self.canvas.winfo_width()
		self.canvas_height = self.canvas.winfo_height()
		if not min(self.canvas_width, self.canvas_height) > 1: return print("Insufficient size to draw canvas") #If the canvas hasn't expanded yet it is only 1x1
		if self.first_draw: self.first_draw = False
		self.background = make_checkerboard(self.canvas_width, self.canvas_height)
		
		self.layer_image = layer.export_image()
		if self.layer_image.size[0] == self.canvas_width and self.layer_image.size[1] == self.canvas_height: pass
		else: self.layer_image = self.layer_image.resize((self.canvas_width, self.canvas_height), Image.BOX)
		
		self.merged_images = self.background
		self.merged_images.paste(self.layer_image, (0,0,self.canvas_width,self.canvas_height), self.layer_image)
		self.merged_images = ImageTk.PhotoImage(self.merged_images)

		self.canvas.create_image(0, 0, image = self.merged_images, anchor = "nw")
		self.pixel_width = (1 / layer.width) * self.canvas_width
		self.pixel_height = (1 / layer.height) * self.canvas_height
		if min(self.pixel_width, self.pixel_height) < 5: return #don't draw lines if tiny
		self.canvas.create_rectangle(0, 0, self.canvas_width, self.canvas_height, outline="#BBBBBB", width = 2)
		for i in range(1, layer.width): self.canvas.create_line(i * self.pixel_width, 0, i * self.pixel_width, self.canvas_height - 1, fill="#BBBBBB", width = 2)
		for i in range(1, layer.height): self.canvas.create_line(0, i * self.pixel_width, self.canvas_width - 1, i * self.pixel_width, fill="#BBBBBB", width = 2)
		if layer.selection:
			for id in layer.selection:
				self.draw_pixel(id)

	#Uses stored pixel widths and heights for calculation
	def draw_pixel(self, id):
		x, y =  (float(v) for v in id.split("x"))
		x1 = x * self.pixel_width
		y1 = y * self.pixel_width
		x2 = (x * self.pixel_width) + self.pixel_width
		y2 = (y * self.pixel_width) + self.pixel_height

		self.canvas.create_rectangle(x1, y1, x2, y2, outline="#EEEEEE", width = 4)

	#puts an image in the center of a pixel
	def draw_pixel_image(self, id, tkimage):
		p = self.project.selected_frame.selected_layer.pixeldict[id]
		x, y =  (float(v) for v in id.split("x"))
